--
-- Structure for view `batch_statistics`
--
DROP TABLE IF EXISTS `batch_statistics`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `batch_statistics`  AS SELECT `b`.`batch_id` AS `batch_id`, `b`.`batch_code` AS `batch_code`, `b`.`batch_name` AS `batch_name`, `b`.`status` AS `status`, `b`.`expected_quantity` AS `expected_quantity`, count(`e`.`scan_id`) AS `scanned_count`, sum(case when `e`.`quality` = 'good' then 1 else 0 end) AS `good_eggs`, sum(case when `e`.`quality` = 'bad' then 1 else 0 end) AS `bad_eggs`, CASE WHEN count(`e`.`scan_id`) > 0 THEN round(sum(case when `e`.`quality` = 'good' then 1 else 0 end) / count(`e`.`scan_id`) * 100,2) ELSE 0 END AS `good_percentage`, `b`.`start_date` AS `start_date`, `b`.`end_date` AS `end_date` FROM (`production_batches` `b` left join `egg_scans` `e` on(`b`.`batch_id` = `e`.`batch_id`)) GROUP BY `b`.`batch_id`, `b`.`batch_code`, `b`.`batch_name`, `b`.`status`, `b`.`expected_quantity`, `b`.`start_date`, `b`.`end_date` ;

