-- Structure for view `egg_quality_summary`
--
DROP TABLE IF EXISTS `egg_quality_summary`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `egg_quality_summary`  AS SELECT cast(`egg_scans`.`scanned_at` as date) AS `scan_date`, count(0) AS `total_scanned`, sum(case when `egg_scans`.`quality` = 'good' then 1 else 0 end) AS `good_count`, sum(case when `egg_scans`.`quality` = 'bad' then 1 else 0 end) AS `bad_count`, round(sum(case when `egg_scans`.`quality` = 'good' then 1 else 0 end) / count(0) * 100,2) AS `good_percentage` FROM `egg_scans` GROUP BY cast(`egg_scans`.`scanned_at` as date) ORDER BY cast(`egg_scans`.`scanned_at` as date) DESC ;

