--
-- Structure for view `user_activity_summary`
--
DROP TABLE IF EXISTS `user_activity_summary`;

CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `user_activity_summary`  AS SELECT `u`.`user_id` AS `user_id`, `u`.`name` AS `name`, `u`.`email` AS `email`, `u`.`role` AS `role`, count(distinct `s`.`session_id`) AS `total_sessions`, max(`s`.`last_activity`) AS `last_login`, count(distinct `e`.`scan_id`) AS `eggs_scanned`, count(distinct `r`.`report_id`) AS `reports_generated` FROM (((`users` `u` left join `user_sessions` `s` on(`u`.`user_id` = `s`.`user_id`)) left join `egg_scans` `e` on(`u`.`user_id` = `e`.`scanned_by`)) left join `reports` `r` on(`u`.`user_id` = `r`.`user_id`)) WHERE `u`.`is_active` = 1 GROUP BY `u`.`user_id`, `u`.`name`, `u`.`email`, `u`.`role` ;

